import React, { Component } from 'react'
import pic from '../content/images/portfolio/chromatone.png'

export default class GridElement extends Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<article className="style0">
				<span className="image">
					<img src={this.props.img} alt=""></img>
				</span>
					<a target="_blank" rel="noreferrer" href={this.props.url}>
						<div className="spacing"></div>
						<h2 className="content">{this.props.title}</h2>
						<div className="content">
							<p>{this.props.description}</p>
						</div>
					</a>
			</article>
		)
	}
}
